import Layout from '../components/Layout'
import Private from '../components/auth/Private'
import DisplaySinglePost from '../components/DisplaySinglePost'

const Post = () => {
  return (
    <Layout>
      <Private>
        <DisplaySinglePost />
      </Private>
    </Layout>
  )
}

export default Post
